import * as identity from "@iota/identity-wasm/web"; identity.init().then(() => { const key = new identity.KeyPair(identity.KeyType.Ed25519) const doc = identity.Document.fromKeyPair(key) console.log("Key Pair", key) console.log("DID Document: ", doc)
}); // or (async () => { await identity.init() const key = new identity.KeyPair(identity.KeyType.Ed25519) const doc = identity.Document.fromKeyPair(key) console.log("Key Pair", key) console.log("DID Document: ", doc)
})() // Default path is "identity_wasm_bg.wasm", but you can override it like this
await identity.init("./static/identity_wasm_bg.wasm"); identity.init().then(<callback>) or await identity.init() is required to load the wasm file (from the server if not available, because of that it will only be slow for the first time)

4.body:
Decentralized Identifiers (DID) is the fundamental standard that supports the concept of a decentralized digital identity. A DID is a unique identifier that contains enough information to be resolved to a DID Document. This document contains data such as public keys, enabling the holder to prove ownership over their personal data, but also URI's that link to public information about the identity. This implementation complies to the DID specifications v1.0 Working Draft 20200731 . Please consult the linked standard for more information about the concept of a Decentralized Identifier or consult the welcome page of the documentation portal for a more highly explaination and more resources. In the IOTA Identity framework, we have implemented the DID standard according to the iota DID Method Specification, which can be viewed here . An example of DID conforming to the iota method specification: did:iota:8dQAzVbbf6FLW9ckwyCBnKmcMGcUV9LYJoXtgQkHcNQy Example of Publishing a DID Document to the Tangle use identity::iota::Client;
use identity::iota::IotaDocument; //Setting up the IOTA Network let client: Client = Client::new()?;
let network: &str = client.network().as_str(); //Generating a DID Document
let (mut document, keypair): (IotaDocument, KeyPair) = IotaDocument::builder().did_network(network).build()?; //Signing and publish to the Tangle
document.sign(keypair.secret())?;
document.publish_with_client(&client).await?;
